import './App.css';
import {  BrowserRouter as Router ,Switch, Route} from "react-router-dom";
import { Link } from "react-router-dom";

import LoginPage from './Views/LoginPage'
import Member_View from './Views/Member_View'



function App() {
  return (
    <div className="App">
  <Router>

    <Switch>  
      <Route exact path = "/" >
          <LoginPage/>             
      </Route>

      <Route exact path = "/Member_View">
          <Member_View/>
      </Route>

    </Switch>
   </Router>

    </div>
  );
}

export default App;
